import React, {Component} from 'react';
import './styles/Homepage.css';

class Homepage extends Component {
	render(){
		return(
		<React.Fragment>
			<div className="newsContainer">
				<div className="newsRow">
				</div>
			</div>
		</React.Fragment>
		)
	}
}
export default Homepage;
